import React, {Component} from 'react';
import Card from './Card';
import './CardList.css'

class CardList extends Component{
	render(){
		const{list} = this.props;
		return(
			<div className = 'hello'>
				{
					list.map((item, index) =>{
						return <Card key = {list[index].id} name = {list[index].name} img = {list[index].image}/>;
					})
				}
			</div>
		);
	}
}

export default CardList;
